import React from 'react';

const VideoPlayer = ({ video }) => {
    if (!video) return <p>Select a video to play</p>;
    return (
        <div>
            <h2>{video.title}</h2>
            <video controls>
                <source src={video.url} type="video/mp4" />
                Your browser does not support the video tag.
            </video>
        </div>
    );
};

export default VideoPlayer;
